description:
Verenigd Koninkrijk
Science-Fiction / Thriller
100 minuten

een goeie film

met Sean Faris, Rachael Taylor en Luke Ford

Een groep jonge militairen leent een ultra geheime gevechtsimulator voor een weekend gamen. Wanneer ze het systeem instellen op 
een gevangenis waar 9/11 gevangenen gemarteld werden, komen ze erachter dat iets of iemand zichzelf naar het systeem geupload 
heeft. Een dodelijke nieuwe speler doet nu mee: Hoe overleven ze het laatste level van de game wanneer ontsnappen onmogelijk is 
en de vijand niet te stoppen?.
